    public ArrayList<Country> getCountries() {
        //Vytvorim ArrayList, do kterého budu ukládat zpracovane zeme
        ArrayList<Country> countries = new ArrayList<>();

        //Odstranim z inputu uvozovky, které tam nechci
        input = input.replace("\"", "");

        //Pokud je hdp z nejakeho ruku neznámé ("NA"), nahradím "NA" za -1 (požadavek v zadání 1. úkolu)
        input = input.replace("NA", "-1");

        //Rozdelim input na radky
        String[] lines = input.split("\n");

        //Projedu vsechny radky forem
        for (int i = 0; i < lines.length; i++) {
            //Radek rozdelim podle radek
            String[] line = lines[i].split(",");

            //Protoze nektere zeme maji v nazvu "," indexy jsou občas posunuty o 1. Tato proměná značí tento posun
            int skip = 0;

            //Pokud je delka splitnuteho radku 16 (to znamená, že je tam údaj navíc) přičtu k proměné split 1, aby jsem posunul indexy
            if(line.length == 16) skip++;

            //Vytvořím instanci země
            Country country = new Country(line[2+skip], line[1]);

            //Přidám k zemi hdp za jednotlivé roky. Používám k tomu metodu, kterou jsem si vytvořil ve třídě "Country"
            country.addGdp("2010", Double.parseDouble(line[3 + skip]));
            country.addGdp("2011", Double.parseDouble(line[4 + skip]));
            country.addGdp("2012", Double.parseDouble(line[5 + skip]));
            country.addGdp("2013", Double.parseDouble(line[6 + skip]));
            country.addGdp("2014", Double.parseDouble(line[7 + skip]));
            country.addGdp("2015", Double.parseDouble(line[8 + skip]));
            country.addGdp("2016", Double.parseDouble(line[9 + skip]));
            country.addGdp("2017", Double.parseDouble(line[10 + skip]));
            country.addGdp("2018", Double.parseDouble(line[11 + skip]));
            country.addGdp("2019", Double.parseDouble(line[12 + skip]));
            country.addGdp("2020", Double.parseDouble(line[13 + skip]));
            country.addGdp("2021", Double.parseDouble(line[14 + skip]));

            //Zemi přidám do listu
            countries.add(country);
        }

        //Vrátím list zemí
        return countries;
    }
